INSERT INTO public.marketplace_listings (id, user_id, category_id, title, description, price, condition, status, location, latitude, longitude, address_city, address_country, views_count, show_on_map, original_language, created_at, updated_at, storefront_id, external_id, metadata, needs_reindex, address_multilingual) VALUES (379, 6, 1501, 'Moderna trpezarijska stolica', 'Elegantna trpezarijska stolica u bež boji. Izrađena od kvalitetnog materijala sa tapaciranim sedištem i naslonom u tekstilu nalik filcu. Drvene noge u prirodnoj boji. Stolica je u odličnom stanju, pogodna za trpezariju ili kancelarijski prostor. Minimalistički dizajn koji se uklapa u različite enterijere.', 4500.00, 'used', 'active', 'Васе Стајића 18, Нови Сад 21101, Јужнобачки управни округ, Србија', 45.25126648, 19.84361839, 'Нови Сад', 'Србија', 0, true, 'sr', '2025-10-03 17:39:10.491046', '2025-10-03 17:39:10.491046', NULL, '', NULL, false, '{"en": "Vase Stajica 18, Novi Sad 21101, South Bačka District, Serbia", "ru": "Васе Стајића 18, Нови-Сад 21101, Южно-Бачский округ, Сербия", "sr": "Васе Стајића 18, Нови Сад 21101, Јужнобачки управни округ, Србија"}');
INSERT INTO public.marketplace_listings (id, user_id, category_id, title, description, price, condition, status, location, latitude, longitude, address_city, address_country, views_count, show_on_map, original_language, created_at, updated_at, storefront_id, external_id, metadata, needs_reindex, address_multilingual) VALUES (382, 6, 1107, 'Huawei Bežični Ruter', 'Huawei WiFi ruter u odličnom stanju. Uređaj poseduje dve eksterne antene za bolji prijem signala, perforiran dizajn za bolje hlađenje i LED indikatore za status. Podržava dual-band tehnologiju i ima više LAN portova za žičano povezivanje. Ruter je u beloj boji i idealan je za kućnu ili kancelarijsku upotrebu.', 3500.00, 'used', 'active', 'Белград', 0.00000000, 0.00000000, 'Белград', 'Србија', 0, false, 'sr', '2025-10-05 19:13:23.984365', '2025-10-05 19:13:23.984365', NULL, '', NULL, false, NULL);
